                    "html": "&lt;script&gt;\n/**\n * ===================== TEXT REPLACER for WEBCAKE =====================\n * - Giữ nguyên markup/animation (không dùng innerHTML/textContent).\n * - Chỉ chỉnh nodeValue của text node.\n * - Tự bật white-space: pre-line nếu chuỗi có &quot;\\n&quot;.\n * =====================================================================\n */\n\nconst MAPPING = [\n{ id: &quot;w-6o12f2p3&quot;, text: &quot;Minh Hoàng &amp; Mai Hương &quot;},\n{ id: &quot;w-19tqxf4g&quot;, text: &quot;14/12/2025 &quot;},\n{ id: &quot;w-gksl9w4l&quot;, text: &quot;NHÀ TRAI &quot;},\n{ id: &quot;w-91jxhp0m&quot;, text: &quot;Quận 4, TP. Hồ Chí Minh &quot;},\n{ id: &quot;w-ig5jcswu&quot;, text: &quot;ÔNG TRẦN QUỐC TUẤN\\nBÀ LÊ THỊ MỸ DUYÊN &quot;},\n{ id: &quot;w-j8n1a9zw&quot;, text: &quot;NHÀ GÁI &quot;},\n{ id: &quot;w-2hyi8ra3&quot;, text: &quot;Quận 8, TP. Hồ Chí Minh &quot;},\n{ id: &quot;w-bv74resi&quot;, text: &quot;ÔNG PHẠM GIA LONG\\nBÀ NGUYỄN THỊ NGỌC HẠNH &quot;},\n{ id: &quot;w-32etj2r3&quot;, text: &quot;Trân Trọng Báo Tin Lễ Thành Hôn Của &quot;},\n{ id: &quot;w-6i7xa1kt&quot;, text: &quot;Trần Minh Hoàng &quot;},\n{ id: &quot;w-giudke9b&quot;, text: &quot;Phạm Mai Hương &quot;},\n{ id: &quot;w-06qxu29u&quot;, text: &quot;LỄ THÀNH HÔN &quot;},\n{ id: &quot;w-bjpwx8mt&quot;, text: &quot;14:00 - Chủ Nhật &quot;},\n{ id: &quot;w-rseyog64&quot;, text: &quot;14.12.2025 &quot;},\n{ id: &quot;w-g4073goa&quot;, text: &quot;(Tức Ngày 25 Tháng 10 Năm Ất Tỵ) &quot;},\n{ id: &quot;w-s69wqls0&quot;, text: &quot;Tại Tư Gia Nhà Trai &quot;},\n{ id: &quot;w-hlq7emov&quot;, text: &quot;TIỆC MỪNG LỄ THÀNH HÔN &quot;},\n{ id: &quot;w-1s1asqe2&quot;, text: &quot;18:00 - Chủ Nhật &quot;},\n{ id: &quot;w-l4swe8pv&quot;, text: &quot;14.12.2025 &quot;},\n{ id: &quot;w-gt9v82sq&quot;, text: &quot;(Tức Ngày 25 Tháng 10 Năm Ất Tỵ) &quot;},\n{ id: &quot;w-jk8yeiwi&quot;, text: &quot;Tại Adora Center – Phú Nhuận &quot;},\n{ id: &quot;w-8799m2jd&quot;, text: &quot;ADORA CENTER – PHÚ NHUẬN &quot;},\n{ id: &quot;w-b8ao84la&quot;, text: &quot;431 Hoàng Văn Thụ, Phường 4, TP. Hồ Chí Minh &quot;},\n];\n\n/** Giữ markup: chỉ đổi nodeValue của text node */\nfunction setTextPreserve(el, newText) {\n  if (!el) return;\n  const tag = el.tagName?.toLowerCase?.();\n  if (tag === &quot;input&quot; || tag === &quot;textarea&quot;) {\n    el.value = newText;\n    return;\n  }\n  // Nếu có xuống dòng mà CSS chưa hiển thị, bật pre-line cục bộ\n  if (newText.includes(&quot;\\n&quot;)) {\n    const ws = (el instanceof Element) ? getComputedStyle(el).whiteSpace : &quot;normal&quot;;\n    if (ws === &quot;normal&quot;) el.style.whiteSpace = &quot;pre-line&quot;;\n  }\n  // 1) ưu tiên text node trực tiếp\n  const directText = Array.from(el.childNodes).find(n =&gt; n.nodeType === Node.TEXT_NODE);\n  if (directText) { directText.nodeValue = newText; return; }\n  // 2) nếu text nằm sâu trong các span wrapper (phục vụ animation)\n  const walker = document.createTreeWalker(\n    el,\n    NodeFilter.SHOW_TEXT,\n    { acceptNode: n =&gt; n.nodeValue.trim() ? NodeFilter.FILTER_ACCEPT : NodeFilter.FILTER_REJECT }\n  );\n  const firstText = walker.nextNode();\n  if (firstText) firstText.nodeValue = newText;\n}\n\n/** Đợi DOM + 1 frame: tránh ghi trước khi thư viện split text/animation chạy */\nfunction onReady(cb) {\n  const run = () =&gt; requestAnimationFrame(() =&gt; setTimeout(cb, 0));\n  if (document.readyState === &quot;loading&quot;) {\n    document.addEventListener(&quot;DOMContentLoaded&quot;, run, { once: true });\n  } else {\n    run();\n  }\n}\n\nfunction applyMapping() {\n  for (const { id, text } of MAPPING) {\n    const el = document.getElementById(id);\n    if (el) setTextPreserve(el, text);\n  }\n}\n\nonReady(applyMapping);\n\n/** Nếu Webcake tái render/lazy → áp lại khi các ID mục tiêu xuất hiện */\nconst idSet = new Set(MAPPING.map(m =&gt; m.id));\nconst mo = new MutationObserver(muts =&gt; {\n  for (const m of muts) {\n    for (const node of m.addedNodes || []) {\n      if (!(node instanceof Element)) continue;\n      if (idSet.has(node.id)) { applyMapping(); return; }\n      for (const id of idSet) {\n        if (node.querySelector?.(`#${CSS.escape(id)}`)) { applyMapping(); return; }\n      }\n    }\n  }\n});\nmo.observe(document.documentElement, { childList: true, subtree: true });\n&lt;/script&gt;\n&lt;!--\n/* =====================================================================\n\nTrần Minh Hoàng - 0938124576 -\n2 thiệp riêng cho nhà trai và nhà gái (chung mẫu)\nMẪU ĐỎ MỘC NÂU\nQR: Có\nLàm Gấp: Không\nSử dụng tính năng điền tên khách mời (có phí): Có (thêm phí 99K)\nTrần Minh Hoàng\nChú Rể\nÔNG TRẦN QUỐC TUẤN\nBÀ LÊ THỊ MỸ DUYÊN\nQuận 4, TP. Hồ Chí Minh\nPhạm Mai Hương\nCô Dâu\nÔNG PHẠM GIA LONG\nBÀ NGUYỄN THỊ NGỌC HẠNH\nQuận 8, TP. Hồ Chí Minh\nLỄ THÀNH HÔN\n14:00 - Chủ Nhật 14.12.2025\n(Tức Ngày 25 Tháng 10 Năm Ất Tỵ)\nTư Gia Nhà Trai\nTIỆC MỪNG LỄ THÀNH HÔN\n18:00 - Chủ Nhật 14.12.2025\n(Tức Ngày 25 Tháng 10 Năm Ất Tỵ)\nAdora Center – Phú Nhuận\n431 Hoàng Văn Thụ, Phường 4, TP. Hồ Chí Minh\nhttps://maps.app.goo.gl/rEY4BMbVBai5KmwEA\nLỄ VU QUY\n10:00 - Thứ Hai 15.12.2025\n(Tức Ngày 26 Tháng 10 Năm Ất Tỵ)\nTư Gia Nhà Gái\nTIỆC MỪNG LỄ VU QUY\n12:00 - Thứ Hai 15.12.2025\n(Tức Ngày 26 Tháng 10 Năm Ất Tỵ)\nAdora Luxury – Quận 7\n118 Hoàng Quốc Việt, Phường Phú Mỹ, TP. Hồ Chí Minh\nhttps://maps.app.goo.gl/6cLvxjsnC4fLQZL29\n===================================================================== */\n--&gt;"
